import "./App.css";
import Todo from "./components/Todo";
import NewItem from "./components/NewItem";
import { useState } from "react";

function App() {
  const [todos, setTodos] = useState({
    userId: "",
    title: "",
    completed: "",
  });

  return (
    <div className="App">
      <Todo setTodos={todos} />
      <NewItem />
    </div>
  );
}

export default App;
